import React from "react";
import { Link } from "react-router-dom";
import style from "./styles.module.scss";
import Moment from "react-moment";

const ContactRead = (contact) => {
  return (
    <div className={style["blog"]}>
      <img src={contact.image} alt="image" />
      <div className={style["blog__body"]}>
        <Link className={style["blog__body__title"]} to={`/blogs/${contact.id}`}>{contact.title}</Link>
        <div className={style["blog__body__info"]}>
          <Moment date={contact.createdAt} format="DD MMM, YYYY" /> |{" "}
          {contact.category}
        </div>
        <span>
          {contact.intro}
          <span> </span>
          <Link className={style["blog__body__info"]} to={`/blogs/${contact.id}`}>
            Read more...
          </Link>
        </span>
      </div>
    </div>
  );
};

export default ContactRead;
